import React,{Component} from "react"
import NINE from "../nl_logo.png";
import {BrowserRouter,Link,browserHistory} from "react-router-dom";
import { Icon} from 'semantic-ui-react'
import 'semantic-ui/dist/semantic.min.css';



class Managerheader1 extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            id:this.props.mid
        }
    }
    componentDidMount(){
        console.log(this.state.id)
    }


     onLogoutClic(){
        localStorage.clear();
        window.location="/login"
    }
    onItemClick(){
        //console.log(this.state.id+'')
      this.props.history.push  = ("/manager"+"/"+ this.state.id)

    }

    setRedirect = (event) => {
        event.preventDefault();
       console.log(this.state)
        this.setState({
            redirect: true
        })
        //window.location.reload();
    };

    render() {

    {
        // var id = this.props.match.params.id
        // var month = this.props.match.params.month
        if (this.state.redirect) {
            return <Redirect to={"/manager"+"/"+ this.state.id} />;

        }
    }




        return (
            <BrowserRouter>
            <header>
                <div>
                    <nav>
                        <div className="header">
                        <Link onClick={this.onItemClick} > <img   src={NINE} alt="nineleaps"/> </Link>

                        <Link onClick={this.setRedirect} style={{marginLeft:"650px"}} > <Icon name='home' />   Home</Link>

                           <Link onClick={this.onLogoutClic} style={{marginInlineStart:"left"}}> <Icon name='sign-out' /> Logout</Link>

                        </div>

                    </nav>

                </div>
            </header>
            </BrowserRouter>

        )
    }
}
export default Managerheader1
